import logo from './logo.svg';
import './App.css';
import Post from "./post"

function App() {
  return (
   <main>
    <header>
      <a href="" className="logo">MyBlog</a>
      <nav>
        <a href="">Login</a>
        <a href="">Register</a>
      </nav>
    </header>
    <Post />

   </main>
  );
}

export default App;
